1.	Perlu dilakukan segera pemasangan perambuan dan penerangan jalan di lokasi jalan hauling (jalan crossing baik di Jalan Nasional dan  Jalan Kabupaten) dan dilakukan perkerasan jalan sepanjang 50 meter menuju jalan hauling dan menuju terminal khusus serta berkordinasi dengan Balai Pelaksana Jalan Nasional Maluku Utara;
2.	Perlu dilakukan manajemen rekayasa simpang berupa pemasangan fasilitas perlengkapan jalan di masing - masing simpang yang bersinggungan dengan jalan nasional dan jalan kabupaten;
3.	Perlu adanya penempatan petugas pengatur lalu lintas baik masa konstruksi dan operasional yang bersertifikat dan berkoordinasi dengan instansi terkait di wilayah pembangunan;
4.	Pengadaan rambu-rambu lalu lintas perlengkapan jalan agar dipastikan sesuai dengan PM 13 tahun 2014 serta pengadaan APJ yang sesuai dengan PM 47 tahun 2023.
5.	Terkait dengan akses konstruksi dan operasional ditambahkan dengan rambu lalu lintas yang sesuai dengan penerapan manajemen dan rekayasa lalu lintas dan dilengkapi titik koordinat di dalam dokumen hasil analisis dampak lalu lintas;
6.	Pengangkutan material wajib dilakukan perhitungan muatan dan tata cara pengangkutan dilakukan dengan memperhatikan peraturan Instruksi Menteri PUPR Nomor 01/IN/M/2022 tentang Larangan Pengunaan Kendaraan Berdimensi Lebih dan/atau Bermuatan Lebih Pada Penyelenggaraan Jasa Konstruksi;
7.	Terkait dengan permasalahan dampak sosial khususnya di Jalan Akses keluar masuk karyawan PT Alam Raya Abadi pada masyarakat sekitar Desa Baturaja, Pihak PT. Alam Raya Abadi agar melakukan musyawarah dalam hal penyelesaian permasalahan tersebut.

